import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Books from "./pages/Books";
import Nav from "./components/Nav";

function App() {
  return (
    <Router>
      <div>
        <Nav />

          <Route exact path={["/", "/books"]}>
            <Books />
          </Route>
      </div>
      </Router>
  )
};

export default App;
